  <h1>看控制台</h1>
  <script>
    //箭头函数(ES6新增)
    //简单使用
    let func = x => x * 2
    console.log("func",func(2))

    /* 
    箭头函数和匿名函数的区别

    箭头函数看上去是匿名函数的简写，但是还是有区别的,其中this的作用域不同：
    匿名函数：由于ES6之前js留下的诟病：变量和函数没有作用域（此处描述可能不准确），导致匿名函数中的this指向的window
    箭头函数：this指向的是词法作用域中
    */
    //匿名函数示例
    window.num = 1;
    const obj1 = {
      num: 2,
      func: function(){
        let funcNum = function(){
          console.log("obj1-num",this.num)//匿名函数的this指向window
        }
        funcNum()
      }
    }
    obj1.func();
    //箭头函数示例
    const obj2 = {
      num: 3,
      func: function(){
        let funcNum = () => console.log("obj2-num",this.num)//箭头函数的this指向当前上下文中，即obj2中
        funcNum()
      }
    }
    obj2.func();


    let numberArr = [1,35,3,6,67,4,81,5,0]
    /*
    filter：过滤数据
    filter的回调函数中有3个参数依次是:
    value:当前元素
    index:当前元素的索引
    array:要过滤的数组
    */
    //需求：筛选出比10小的数
    let number2Arr = numberArr.filter(num => num < 10)
    console.log("number2Arr-filter",number2Arr)
    //与for循环对比
    number2Arr = []
    for (const num of numberArr) {
      if(num < 10){
        number2Arr.push(num)
      }
    }
    console.log("number2Arr-for",number2Arr)
    //filter去重
    const number3Arr = [1,2,2,5,9,0,7,5].filter((v,i,self) => self.indexOf(v) === i)
    console.log(number3Arr)


    /*
    map：数据加工
    map的回调函数中有3个参数与filter的回调参数一致
    */
    //需求:数组中每个元素的平方值
    let number4Arr = number2Arr.map( num => num * num)
    console.log("number4Arr-map",number4Arr)
    //与for循环对比
    number4Arr = []
    for (const num of number2Arr) {
      number4Arr.push(num * num)
    }
    console.log("number4Arr-for",number4Arr)


    /*
    reduce：数据汇总
    reduce有两个参数
      参数一：回调参数，回调参数有4个参数
        previousValue: 上一次汇总后的值，第一次汇总时取初始值
        value:当前元素
        index:当前元素的索引
        array: 调用reduce的数组
      参数二：回调函数中previousValue的初始值

    */
    //需求：求数组中各个值相加的和
    let total = number4Arr.reduce((preNum,num) => preNum + num,0)
    console.info("total-reduce",total)
    //与for循环对比
    total = 0
    for (const num of number4Arr) {
        total += num
    }
    console.info("total-for",total)
